def create_ratings(user_size, filename, mode):
    ratings = np.zeros(shape=(user_size, 150))
    with open('jester_dataset_2/jester_ratings.dat') as file:
        lines = file.readlines()
        temp_sample = [i for i in range(max_user_size)]
        for user in no_rating_users:
            temp_sample.remove(user - 1)
        if mode == 'random':
            if user_size < len(temp_sample):
                sample = random.sample(temp_sample, user_size)
            else:
                sample = temp_sample
        elif mode == 'top':
            if user_size < len(temp_sample):
                sample = [temp_sample[i] for i in range(user_size)]
            else:
                sample = temp_sample
        else:
            raise ValueError
        for line in lines:
            user_id, item_id, rating = line.split('\t\t')
            user_id = int(user_id) - 1
            if user_id in sample:
                ratings[sample.index(user_id), int(item_id) - 1] = round(float(rating) + 11)
    dump(filename, ratings)
    return ratings


def main():
    parser = argparse.ArgumentParser(description='create ratings')
    parser.add_argument('-s', '--size', type=int, required=True)
    parser.add_argument('-f', '--filename', required=True)
    parser.add_argument('-m', '--mode', default='top', choices=['top', 'random'])
    args = parser.parse_args()
    create_ratings(args.size, args.filename, args.mode)


if __name__ == '__main__':
    main()
